import { useHistory } from 'react-router-dom'
const Protected = () => {
    function checkAuth() {
        const history = useHistory();
        const storedData = JSON.parse(localStorage.getItem("MyUser"));
        if (!storedData._id) {
            return history.push("/");
        }
    }
}
export default Protected
